function importEnterpriseDatas(data) {
  let promise = [];
  _.each(data, function (val) {
    try {
      promise.push(
        new Promise(function (resolve, reject) {
          models.Enterprise.create(val).then(function (result) {
            resolve();
          });
        })
      );
    } catch (err) {
      debug(`ERROR from importEnterprise: %j`, err);
    }
  });
  return Promise.all(promise);
}
